import Masangudi from '../../assets/images/masangudi.png'
export default function DetailsPage(){
    return(
        <>
        <Header />
        <div id="places-container">
            <p>Masungudi</p>
            <img src={Masangudi} alt="places" />
        </div>
        </>
    );
}
